import React from "react";

function MoviesCard(props) {
    return (
        <figure className="movies-card">
            <figcaption className="movies-card__about">
                <p className="movies-card__title"></p>
                <p className="movies-card__length"></p>


            </figcaption>
            <a>
                <img />
            </a>
        </figure>


    );
}

export default MoviesCard;
